import React, { useState, useEffect } from 'react';
import Auth from './components/Auth.js';
import Products from './components/Products.js';
import OrderPlacement from './components/OrderPlacement.js';
import OrderHistory from './components/OrderHistory.js';
import AdminPanel from './components/Admin/AdminPanel.js';
import AdminLogin from './components/Admin/AdminLogin.js';
import logo from './assets/logo.png';
console.log('logo', logo);

const App = () => {
  const [currentPage, setCurrentPage] = useState('auth'); // 'auth', 'products', 'orderPlacement', 'orderHistory', 'admin', 'adminLogin'
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [cart, setCart] = useState([]); // New state for the cart
  const [authToken, setAuthToken] = useState(null); // New state for authentication token
  const [userEmail, setUserEmail] = useState(null); // New state for user email
  const [logoError, setLogoError] = useState(false);

  useEffect(() => {
    const storedToken = localStorage.getItem('authToken');
    const storedEmail = localStorage.getItem('userEmail');
    if (storedToken && storedEmail) {
      setAuthToken(storedToken);
      setUserEmail(storedEmail);
      setIsLoggedIn(true);
      if (storedEmail === 'admin@gmail.com') {
        setCurrentPage('admin');
      } else {
        setCurrentPage('products');
      }
    }
  }, []);

  const handleLoginSuccess = (token, email) => {
    localStorage.setItem('authToken', token);
    localStorage.setItem('userEmail', email);
    setIsLoggedIn(true);
    setAuthToken(token); // Store the token
    setUserEmail(email);
    if (email === 'admin@gmail.com') {
      setCurrentPage('admin');
    } else {
      setCurrentPage('products');
    }
  };

  const handleAdminLogin = () => {
    setCurrentPage('adminLogin');
  };

  const handleBackToLogin = () => {
    setCurrentPage('auth');
  };

  const handleCheckout = (productsInCart) => {
    setCart(productsInCart);
    setCurrentPage('orderPlacement');
  };

  const handleOrderConfirmed = () => {
    setCart([]); // Clear cart after order is confirmed
    setCurrentPage('products');
  };

  const handleLogout = () => {
    localStorage.removeItem('authToken');
    localStorage.removeItem('userEmail');
    setIsLoggedIn(false);
    setAuthToken(null); // Clear the token on logout
    setCurrentPage('auth');
    setCart([]); // Clear cart on logout
  };

  return (
    <div style={styles.appContainer}>
      <header style={styles.header}>
      <img 
        src="data:image/png;base64," 
        alt="Company Logo" 
        style={styles.headerLogo} // Adjust as needed
      />
      <h4 className='pacifico'>Food Service</h4>
        {isLoggedIn && (
          <nav style={styles.nav}>
            <button onClick={() => setCurrentPage('products')} style={styles.navButton}>Products</button>
            <button onClick={() => setCurrentPage('orderHistory')} style={styles.navButton}>Orders</button>
            <button onClick={handleLogout} style={styles.navButton}>Logout</button>
          </nav>
        )}
      </header>
      <main style={styles.mainContent}>
        {!isLoggedIn && currentPage === 'auth' && <Auth onLoginSuccess={handleLoginSuccess} onAdminLogin={handleAdminLogin} styles={styles} />}
        {!isLoggedIn && currentPage === 'adminLogin' && <AdminLogin onLoginSuccess={handleLoginSuccess} onBack={handleBackToLogin} styles={styles} />}
        {isLoggedIn && (
          <>
            {currentPage === 'products' && <Products onCheckout={handleCheckout} styles={styles} authToken={authToken} />}
            {currentPage === 'orderPlacement' && <OrderPlacement cart={cart} onOrderConfirmed={handleOrderConfirmed} styles={styles} authToken={authToken} />}
            {currentPage === 'orderHistory' && <OrderHistory styles={styles} authToken={authToken} />}
            {currentPage === 'admin' && <AdminPanel styles={styles} authToken={authToken} />}
          </>
        )}
      </main>
    </div>
  );
};

